import React from 'react';
import ReactTable from "react-table";
import { Link } from "react-router-dom";
 
import { ToastContainer, toast} from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

const TaskList=(props:{name:string})=> {

    let columns = [
        {
          Header: "taskuuid",
          accessor: "taskuuid",
          show: false,
             
          
        },
        {
          Header: "Title",
          accessor: "Title",
          sortable: true,
          show: true,
          displayValue: "Title"
          
        },  
        {
            Header: "Description",
            accessor: "description",
            sortable: true,
            show: true,
            displayValue: "Discription"
            
          },  
          {
            Header: "Status",
            accessor: "status",
            sortable: true,
            show: true,
            displayValue: "status"
            
          },  
        {
          Header: "Created Date",
          accessor: "createDt",
          sortable: true,
          show: true,            
          displayValue: "Created Date"
          
        },
        {
          Header:"Download",
          maxWidth: 100,
           
          Cell:row => (<div className="grdbuttoncontainer"><div className="downloadcontainer"> <a
              className="downloadbutton"
              aria-label="Download"
              onClick={(event) => this.handlePDFClick(row,event)}
          >
              <i className="">
                  <img
                      alt="PDF"
                      className=""
                      src="/images/pdf_icon.png"
                      title="PDF"
                  />
                   
              </i>
          </a>
          <a
              className="downloadbutton"
              aria-label="Download"
              onClick={(event) => this.handleCSVClick(row,event)}
          >
              <i className="">
                  
                  <img
                      alt="CSV"
                      className="ml-3"
                      src="/images/csv_icon.png"
                      title="CSV"
                  />
              </i>
          </a>
          </div></div>)
        }   
       
      ];
      this.setState({ columns });
  return (
     <div>  {props.name?'Task list page '+props.name:'Not validat user'}
      
    </div>
  )
}

export default TaskList
